import "../assets/styles/HomePageStyles.css";

function HomePage() {
  

  return (
    <div>
      <div className="main-style">
        <animated.div style={style1}>
          <h3 className="first-row">Hello Friends</h3>
        </animated.div>
        <animated.div style={style2}>
          <h3 className="second-row">My Name Is Orald</h3>
        </animated.div>
        <animated.div style={style3}>
          <h3 className="third-row">I Am Web Developer</h3>
        </animated.div>
        <animated.div style={style4}>
          <h3 className="forth-row">Main Frameworks are REACT And DJANGO</h3>
        </animated.div>
      </div>
    </div>
  );
}

export default HomePage;
